	('0e9f487ca35a', '2', 0, NULL, '2022-02-04 19:34:29', '2022-02-04 21:10:29', 'ff2ed0cab03e', 'fec746d4520a', '318e064ea0c9', 'singletext', '{"text": "<p>Wir machen uns auf den Weg ins Hogwarts-Sommer-Camp.</p>"}'),
	('8b967bf8d778', '2', 1, NULL, '2022-02-04 19:34:29', '2022-02-04 21:12:05', 'ff2ed0cab03e', 'fec746d4520a', '44dcc7493c65', 'singletext', '{"text": "<p>Velomechs auf der <strong>Strecke</strong>:</p><ul><li><p>Velos - Motos Ryser, Musterdorf, 077 123 45 67</p></li><li><p>Radprofi Weibel, Ennetda, 021 123 45 67</p></li></ul>"}'),
	('05fd1a6276a0', '2', 0, NULL, '2022-02-04 19:36:21', '2022-02-04 21:13:25', 'a71f929dd156', 'bd796fec1ea0', '318e064ea0c9', 'singletext', '{"text": "<p>Ein Sommercamp baut sich nicht von alleine auf -&gt; das tun wir jetzt.</p>"}'),
	('ea1ab136a55b', '2', 2, NULL, '2022-02-04 22:10:06', '2022-02-04 22:10:06', '37616c74811f', '4d88b71250c5', '4f0c657fecef', 'singletext', '{"text": ""}'),
	('fd9297b1db56', '2', 1, NULL, '2022-02-04 22:10:06', '2022-02-04 22:10:06', '37616c74811f', '4d88b71250c5', '44dcc7493c65', 'singletext', '{"text": ""}'),
	('80352238933c', '2', 0, NULL, '2022-02-04 22:10:52', '2022-02-04 22:10:52', '78c9196140b7', '16c1b1868c60', '318e064ea0c9', 'singletext', '{"text": ""}'),
	('283a58df7d9b', '2', 0, NULL, '2022-02-04 19:37:23', '2022-02-04 21:16:37', 'd62d16c6afb6', '2210bc67a4ce', '318e064ea0c9', 'singletext', '{"text": "<p>Die Teilnehmer erreichen Das Hogwarts-Sommercamp und erfahren dessen wahre Bedeutung - wir wollen Harry''s Horkruxe zerstören und ihn so wieder zu dem liebenswerten Zauberer machen, den wir alle kennen und lieben. Denn seit dem Ende der Buchserie ist einige Zeit vergangen und Harry ist der Erfolg zu Kopf gestiegen. Süchtig nach Macht hat auch er, wahrscheinlich durch die hinterlassenen Spuren des Daseins als Voldemort''s Horkrux, sieben Horkruxe erschaffen. Unsere Aufgabe ist es nun, diese zu finden und zu zerstören, so dass Harry''s Seele wieder ganz wird. Da wir offiziell aber natürlich das Image des Hogwarts-Sommercamps aufrecht erhalten müssen, werden die Teilnehmer in vier Häuser aufgeteilt (20 TN --&gt; 4 Gruppen à 5). Dies sind die Zeltgruppen und in ihnen können die TN Punkte für ihre Häuser sammeln indem sie z.B. das erste komplett anwesende Zelt sind wenn es pfeift etc. Die Hogwarts-Häuser competition wird also auch in unserem \"Sommercamp\" weitergeführt. Leiter des Camps is Albus Potter, Harry''s Sohn.</p><p>Die Figuren stellen sich vor: Hauslehrer</p><p>Farfalla: Gryffindor</p><p>Castor: Slytherin</p><p>Biber: Ravenclaw</p><p>Salamander: Hufflepuff</p><p>Adler: Filch</p><p>Pandora: Irgende WEasly</p><p>Weiter mögliche Personen:</p><p>Albus Potter, Ted Lupin, Rose oder Hugo Weasly, Scorpius Malfoy, Swagrid</p><p>Allgemeine Dinge über das Harry Potter universum werden erzählt:</p><p>- häuser, Hogwarts, verbotener wald, zaubersprüche, das ministerium, spezielle wesen wie zentauren phönix etc., denkarium..?</p>"}'),
	('651220bcea22', '2', 0, NULL, '2022-02-04 19:38:15', '2022-02-04 21:17:04', 'c7a28bcfd35f', '142195e3898c', '318e064ea0c9', 'singletext', '{"text": "<p>Zum die Horkrux zu sammeln müssen wir zusammen halten. Dadurch spielen wir verschiedene Spiele um uns besser kennen zu lernen.</p>"}'),
	('a70a441e44d0', '2', 1, NULL, '2022-02-04 19:38:15', '2022-02-04 21:18:21', 'c7a28bcfd35f', '142195e3898c', '44dcc7493c65', 'singletext', '{"text": "<p>Apotheke mitnehmen</p>"}'),
	('063244de52d6', '2', 0, NULL, '2022-02-04 19:39:09', '2022-02-04 21:18:50', '83b61af97910', 'f6163448c705', '318e064ea0c9', 'singletext', '{"text": "<p>Damit wir herausfinden, warum Harry böse wurde, müssen wir uns in seine Rolle versetzen, bevor er böse wurde. In Hogwarts gibt es verschiedene Gestalten, in die wir uns vertiefen wollen.</p>"}'),
	('6fa0ee230602', '2', 2, NULL, '2022-02-04 19:39:09', '2022-02-04 21:19:00', '83b61af97910', 'f6163448c705', '4f0c657fecef', 'singletext', '{"text": "<p>Die ganze Erklärung des Games auf externem Sheet.</p>"}'),
	('8ec651d8892c', '2', 1, NULL, '2022-02-04 19:39:09', '2022-02-04 21:19:24', '83b61af97910', 'f6163448c705', '44dcc7493c65', 'singletext', '{"text": ""}'),
	('ea63d22b8898', '2', 0, NULL, '2022-02-04 19:39:53', '2022-02-04 21:20:28', '02823e618716', 'b570ee7e3999', '318e064ea0c9', 'singletext', '{"text": "<p>In unserem Sommercamp brauchen wir Regeln, wie es sie in Hogwarts auch gibt (nicht in den Verbotenen Wald etc.) Deshalb machen wir uns nun daran, diese Regeln festzulegen.</p>"}'),
	('a2949c251d61', '2', 1, NULL, '2022-02-04 19:40:24', '2022-02-04 21:23:32', 'c6eb39db9f9c', 'e5618cc0b5e8', '44dcc7493c65', 'singletext', '{"text": ""}'),
	('886f1428cadd', '2', 0, NULL, '2022-02-04 21:25:12', '2022-02-04 21:25:37', '645000130f8c', '645000130f8c', '318e064ea0c9', 'singletext', '{"text": "<p>Jeder Zauber braucht eine Spezialfähigkeit. Die hier angebotenen sind besonders wichtig im Kampf gegen Horkruxe, deshalb benötigen wir Experten auf jedem der Gebiete. Quasi Wahlfach des Sommercamps</p>"}'),
