	('b76e3ea5d4a8', '2', 0, NULL, '2022-02-04 21:31:00', '2022-02-04 21:31:40', '3edf02e5fd3d', '51a9f1de497a', '318e064ea0c9', 'singletext', '{"text": "<p>Roter Baron:</p><p>Er hatte den Auftrag, seine Geliebte wieder zurück zu holen, als sie sich jedoch weigerte, hatte er einen Wutausbruch und brachte sie um. Seitdem trägt er Ketten, um Busse zu tun. Er bereut diese Tat zutieftst und möchte mit uns anschauen, wie man seine Gefühle im Griff hat.</p>"}'),
