	('2b12a73ce7b9', '2', 0, NULL, '2022-02-04 22:28:12', '2022-02-04 22:28:12', '980885505aad', '82b8c7554597', '318e064ea0c9', 'singletext', '{"text": ""}'),
	('6adc7e08d593', '2', 2, NULL, '2022-02-04 22:28:12', '2022-02-04 22:28:12', '980885505aad', '82b8c7554597', '4f0c657fecef', 'singletext', '{"text": ""}'),
	('7c03a78afcce', '2', 1, NULL, '2022-02-04 22:28:12', '2022-02-04 22:28:12', '980885505aad', '82b8c7554597', '44dcc7493c65', 'singletext', '{"text": ""}'),
	('7a2282e04097', '2', 0, NULL, '2022-02-04 22:06:20', '2022-02-04 22:35:08', '985356416a4b', 'cd9a869ea01c', '318e064ea0c9', 'singletext', '{"text": "<p>Unsere Flugtickets sind davongeflogen (Wind) wir müssen sie wieder einsammeln</p>"}'),
	('ac6b2f123ad3', '2', 0, NULL, '2022-02-04 22:16:56', '2022-02-04 22:39:43', '69fa08a77f38', '3ce6b7ec876f', '318e064ea0c9', 'singletext', '{"text": "<p>Wir fliegen Ab. Die Flugbegleiter erklären uns wie wir in Notfallsituationen handeln müssen.</p>"}'),
	('ae634c4157a0', '2', 1, NULL, '2022-02-04 22:16:56', '2022-02-04 22:39:47', '69fa08a77f38', '3ce6b7ec876f', '44dcc7493c65', 'singletext', '{"text": "<p>Apotheke in Aufenthaltszelt oder Matzelt (Nach SIKO)</p>"}'),
	('94bce49e1f03', '2', 0, NULL, '2022-02-04 22:17:30', '2022-02-04 22:42:11', '5015df0b6259', '69c2c7eceec2', '318e064ea0c9', 'singletext', '{"text": "<p>Wir stürzen ab. Der Pilot verlässt das Flugzeug früher, weil die Steuerung nicht mehr funktioniert und er der Meinung ist, dass wir in die Insel stürzen würden und er nicht sterben will. oder so ähnlch de Pilot isch denn eifach verscholle</p>"}'),
	('3de702618ab9', '2', 0, NULL, '2022-02-04 22:19:53', '2022-02-04 22:45:00', '8e15971caab8', 'ed784a290de3', '318e064ea0c9', 'singletext', '{"text": "<p>Wir müssen die Insel erkunden</p>"}'),
	('17ec8168365a', '2', 0, NULL, '2022-02-04 22:20:19', '2022-02-04 22:47:57', 'f9ba3a735450', 'c20a38fbe5bd', '318e064ea0c9', 'singletext', '{"text": "<p>Die eingeborenen greifen uns an und klauen uns unser essen.</p>"}'),
	('b3f5cbd532da', '2', 1, NULL, '2022-02-04 22:20:19', '2022-02-04 22:48:00', 'f9ba3a735450', 'c20a38fbe5bd', '44dcc7493c65', 'singletext', '{"text": "<p>Apotheke mitnehmen, Gelände vorher absuchen wegen Gefahren</p>"}'),
	('d9b4103a0ab1', '2', 0, NULL, '2022-02-04 22:21:03', '2022-02-04 22:50:58', '280031715953', 'd5cd5fd59e4a', '318e064ea0c9', 'singletext', '{"text": "<p>Pfadigesetzt und Pfadiversprechen durch verschiedene Methoden lernen</p>"}'),
	('84b40e43160a', '2', 1, NULL, '2022-02-04 22:21:03', '2022-02-04 22:51:03', '280031715953', 'd5cd5fd59e4a', '44dcc7493c65', 'singletext', '{"text": "<p>Apotheke im Aufenthalts / Matzelt (Nach SIKO)</p>"}'),
	('7d7fc79c95fd', '2', 0, NULL, '2022-02-04 22:21:35', '2022-02-04 22:52:52', 'd4fe28437432', 'a046328425df', '318e064ea0c9', 'singletext', '{"text": "<p>wir müssen uns unser Essen zurückholen (evtl. Lasergame oder suscht was Geils)</p>"}'),
	('22d8c12d7df3', '2', 1, NULL, '2022-02-04 22:21:35', '2022-02-04 22:52:56', 'd4fe28437432', 'a046328425df', '44dcc7493c65', 'singletext', '{"text": "<p>Gelende vorher Rekken (wespenneste etc)</p><p>Apotheke und handy dabei</p>"}'),
	('307055b3b9ca', '2', 0, NULL, '2022-02-04 22:22:15', '2022-02-04 22:55:45', '7792c9c855ce', '60dad45d3561', '318e064ea0c9', 'singletext', '{"text": "<p>Was könnte man machen um Rettung zu holen? Blubb meint wir sollten warten bis wir gerettet werden und uns ein wenig die Zeit vertreiben</p>"}'),
	('fb7c4182a43f', '2', 2, 'Ziele', '2022-02-04 22:22:38', '2022-02-04 22:58:43', '2b3f79233387', '8d3112f28a34', '4f0c657fecef', 'singletext', '{"text": "<p>Wir lernen das Pfadigeetz und wie wir damit leben.</p>"}'),
	('21bca97eadd7', '2', 1, NULL, '2022-02-04 22:22:38', '2022-02-04 22:59:16', '2b3f79233387', '8d3112f28a34', '44dcc7493c65', 'singletext', '{"text": "<p>Apotheke und Handy vor Ort</p>"}'),
	('47b94d9ba46b', '2', 0, NULL, '2022-02-04 22:22:56', '2022-02-04 23:01:09', '475f7b34581a', '0c57930a0e67', '318e064ea0c9', 'singletext', '{"text": "<p>Plottwist der Pilot hat sich zum Anführer der eingeborenen hochgekämpft. und wir müssen ein Notsignal senden</p>"}'),
	('49d09f48b287', '2', 1, NULL, '2022-02-04 22:22:56', '2022-02-04 23:01:15', '475f7b34581a', '0c57930a0e67', '44dcc7493c65', 'singletext', '{"text": "<p>Apotheke mitnehmen, Gelände vorher absuchen wegen Gefahren. Drei mal Pfeifen = besammeln beim neutralen Posten.</p>"}'),
	('d5114af3e81e', '2', 1, NULL, '2022-02-04 22:24:36', '2022-02-04 23:03:57', 'e460f03e79b4', 'e69cb9c4d43c', '44dcc7493c65', 'singletext', '{"text": "<p>Handy bei leiter</p><p>Aputheke ist auf lagergelende vorhanden</p>"}'),
