	('764477318be2', '1', 0, NULL, '2022-02-04 19:40:24', '2022-02-04 19:40:24', 'c6eb39db9f9c', 'e5618cc0b5e8', 'cfccaecd4bad', 'storyboard', '{"sections": {"d528c7b4-5655-497f-bca0-fd9a0dc4a490": {"column1": "<p>''00 - ''15</p>", "column2": "<p>Als Übergang zum TABS erklärt Farfalla was das Pafdivereprechen ist und wie es in Zusammenhang mit den Pfadigesetzen steht. Dann werden die TN darauf hingewiesen, dass sie im Lager die Möglichkeit haben werden das Versprechen abzulegen (jüngere TN Vorversprechen) und sie sich Gedanken machen sollen, ob sie dies tun wollen oder nicht. Bei Fragen sollen sie sich bei Farfalla melden.</p>", "column3": "<p>Farfalla</p>", "position": 0}, "fb42521c-27a9-482e-9be2-b696a5447ffb": {"column1": "<p>''15 - ''30</p>", "column2": "<p>Wir singen im Kreis ein Bajuschki-Baju und der Ta-Che schliesst den Tag ab (kann selbst entscheiden wie, sicher den TN sagen ab wann Nachtruhe, wie viel Zeit sie zum Zähneputzen etc. haben)</p>", "column3": "", "position": 1}}}'),
	('8af65594aee7', '1', 0, NULL, '2022-02-04 22:21:58', '2022-02-04 22:21:58', 'b46ab3cde287', '23b945a9df75', 'cfccaecd4bad', 'storyboard', '{"sections": {"2e2799b3-2887-455e-bf48-19245346cebb": {"column1": "<p>0000</p>", "column2": "<p>Aufwecken mit Musik</p>", "column3": "", "position": 0}, "4879a95b-a048-490b-b916-e1fe40b583d6": {"column1": "<p>0030</p>", "column2": "<p>Ende und wir gehen Zmorgen essen</p>", "column3": "", "position": 2}, "b699a9e0-d0c3-49ee-8836-8091219d6145": {"column1": "<p>0010</p>", "column2": "<p>Wir machen ein Triff den Dödel. Alle stehen im Kreis und ein Ball wird gegnseitig zugespielt. Der Ball darf nur mit einer Hand geworfen und gefangen werden. Wenn man den Ball nicht fängt muss man eine runde um den kreis rennen. wenn man wärend dieser runde vom Ball getroffen wird, muss man nochmals rennen. Wenn man einen schlechten passt schiesst muss man auch rennen. Die rennende person kann mehrmals wieder abgeschossen werden</p>", "column3": "", "position": 1}}}'),
	('0810d1a172db', '1', 0, NULL, '2022-02-04 19:39:53', '2022-02-04 19:39:53', '02823e618716', 'b570ee7e3999', 'cfccaecd4bad', 'storyboard', '{"sections": {"42ed6f1e-7956-4fd6-8725-f55eded0bbbe": {"column1": "<p>''70-''90</p>", "column2": "<p>Die Regeln werden zusammengetragen, ergänzt was sonst noch auf den Lagerpakt gehört (TN wird erklärt, dass diese Regeln sicherheitsrelevant sind und daher nicht zwingend aus dem Pfadigesetz abgeleitet werden können) und dann mit allen TN durchgegeangen. Am Schluss unterschreiben alle TN den Lagerpakt.</p>", "column3": "<p>Farfalla</p>", "position": 3}, "4f8b6859-33e8-43d3-b44e-7f271931d5c4": {"column1": "<p>''10</p>", "column2": "<p>Der Postenlauf beginnt, es gibt vier Posten à zwei Pfadigesetze, jeder Posten ist von mind. einem Leiter besetzt.</p><p>Die TN haben 10'' Zeit pro Posten und dann 5'' zum Wechseln.</p><p>Der gesamte Postenlauf dauert also 60 Minuten. es pfeift wenn gewechselt wird.</p><p>Die letzte Gruppe bei einem Posten hilft dann dem Leiter mit allem Material zurück zum Aufenthaltszelt- / platz zu kommen.</p><p>Beim Posten bespricht die Gruppe zuerst kurz was diese Pfadigesetze genau bedeuten und überlegt sich dann Reglen dazu, die im Lager nützlich sein könnten. Der Postenbetreuer kann Inputs geben, falls die TN keine Idee mehr haben und schreibt die Regeln der TN auf. Am Ende des Postenlaufs streicht er dann alle doppelten Regeln, sodass nur noch die übrigbleiben, die dann auf den Lagerpakt kommen.</p>", "column3": "", "position": 1}, "67528e31-3b53-47a0-acd8-424047b277c5": {"column1": "<p>''00</p>", "column2": "<p>Erklärung RF und Postenlauf, die TN absolvieren den Postenlauf in ihren Häuser-Gruppen (So lernen sie sich gleich besser kennen)</p>", "column3": "<p>Farfalla</p>", "position": 0}, "79ceddd3-d68b-4d04-8c14-982f38e603bc": {"column1": "<p>''10 - ''70</p>", "column2": "<p>Posten 1: Offen und ehrlich sein und Freude suchen und weitergeben</p><p>(mögliche Regeln: Sagen wenn etwas kaputt geht, zu seinen Missgeschicken stehen etc.)</p><p>Posten 2: andere verstehen und achten und miteinander teilen</p><p>(Mögliche Regeln: kein Mobbing, einander zuhören, wenn Leiter sprechen ist es still...)</p><p>Posten 3: unsere Hilfe anbieten und uns entscheiden und Verantwortung tragen</p><p>(Mögliche Regeln: den Jüngeren helfen, sein Ämtli sauber und korrekt erledigen etc,)</p><p>Psoten 4: Sorge tragen zur Natur und allem Leben und Schwierigkeiten mit Zuversicht begegnen</p><p>(Mögliche Regeln: Abfall in Abfallsack, wenn man ein Problem hat um Hilfe bitten, aber auch Verstand einsetzen ... )</p>", "column3": "<p>Postenbetreuer</p>", "position": 2}}}'),
	('05b712aff209', '1', 0, NULL, '2022-02-04 19:48:40', '2022-02-04 19:48:40', '3d211da36cc6', '99ec103f21e4', 'cfccaecd4bad', 'storyboard', '{"sections": {"1acc16f6-fc34-4916-96df-15ceefc54920": {"column1": "", "column2": "<p>test</p>", "column3": "", "position": 0}}}'),
	('9a4845d2e259', '1', 0, NULL, '2022-02-04 22:06:20', '2022-02-04 22:06:20', '985356416a4b', 'cd9a869ea01c', 'cfccaecd4bad', 'storyboard', '{"sections": {"219983be-c40c-464d-8c26-b65524952a3f": {"column1": "", "column2": "<p>Wir besammeln uns beim Bahnhof Oerlikon und gehen nach der Besammlung zum MFO-Park.</p><p>Die Leiter haben leider die Flugtickets verloren. Die Einzelteile sind nun in ganz Oerlikon verteilt. Wir müssen sie nun wieder einsammeln.</p>", "column3": "", "position": 0}, "27827c38-1ed2-4055-8ae6-bdeed66e420c": {"column1": "", "column2": "<p>Jede Gruppe bekommt eine Karte und es findet ein Stern-OL statt.</p><p>Bei jedem Posten finden sie einen Teil des Tickets</p><p>Jede Gruppe muss bei jedem Posten vorbei.</p>", "column3": "", "position": 2}, "52850311-1263-4e93-b361-014f8e6595ec": {"column1": "", "column2": "<p>Um die Gruppen einzuteilen machen wir ein Atömle: Es rennen alle durcheinander und eine Leitperson sagt eine Zahl. Nun müssen die TN''s sich in Gruppen dieser Anzahl stellen. Alle die nicht in einer Gruppe (einem Atom) sind scheiden aus und werden in Gruppen eingeteilt</p>", "column3": "", "position": 1}, "59519592-a1ed-4117-86e1-806cd40adbe9": {"column1": "", "column2": "<p>Alle Gruppen waren bei allen Posten. Nun müssen sie die Tickets zusammensetzten</p>", "column3": "", "position": 3}}}'),
	('7fb4b671a287', '1', 0, NULL, '2022-02-04 22:22:15', '2022-02-04 22:22:15', '7792c9c855ce', '60dad45d3561', 'cfccaecd4bad', 'storyboard', '{"sections": {"0f270214-029b-4889-9367-3d687e571eba": {"column1": "", "column2": "<p>Was giebt es besseres als zu Snacken beim Warten. Wir erklären den Kindern wie man Brennesselchips macht.</p><p>1. Die Brennnesseln am besten mit Handschuhen schneiden und die Blätter abpflücken</p><p>2. Blätter waschen und in Salatschleuder trocknen. Sobald die Brennnesseln gewaschen sind, brennen sie nicht mehr!</p><p>3. Kokosfett oder Rapsöl in der Pfanne heiss werden lassen, die Brennnesselblätter beifügen und mit der Kelle vorsichtig wenden</p><p>5. Wenn die Blätter knusprig sind, auf Küchenpapier abtropfen lassen</p><p>6. Mit Salz, Curry oder anderen Gewürzen bestreuen und sofort geniessen</p>", "column3": "", "position": 2}, "878cf4ac-3715-4320-8e83-74f5c271197a": {"column1": "", "column2": "<p>Nach einer Weile spielen wir ein Paar spiele um uns wieder etwas zu bewegen.</p><p>Amerikanische Buldoggen</p><p>Schreimauer. Es giebt einen Sender und einen Empfänger. Der Sender muss dem Empfänger eine Nachricht schreien. Die restlichen personen müssen das verhindern indem sie eine Lärmwand machen zwischen dem Sender und dem Empfänger und in dei Reichtung des Senders schreien.</p>", "column3": "", "position": 4}, "95124339-4b73-4168-8d87-b308fe39dc7e": {"column1": "", "column2": "<p>Diverse Bastelspass mit Blubb</p><p>Wir knüpfen Bändeli auf spezielle Art (Beispielbändeli von Blubb)</p><p>Wir lernen wie man einen Kranich faltet. (Bei 1000 Kranich hat man einen Wunsch frei. Wir könnten uns wünschen, dass wir gerettet werden)</p><p>How to make a Hexaflexagon.</p>", "column3": "", "position": 1}, "9b6b4294-77df-4245-ab89-d83c43e89fa1": {"column1": "", "column2": "<p>Für diejenigen die doch noch ewas sinnvolles machen wollen zeigen wir ihnen wie man Zundhölzli wasserdicht macht. Dazu schmilzt man etwas wachs und legt sie im Wachs ein sodass eine Schicht Wachs um das Streichholz entsteht. Dasselbe macht man nun mit dem Anzündstreifen und Voila Wasserdicht.</p><p>Flaschenpost.</p><p>Die Kinder dürfen frei eine Nachricht entwerfen die wir in eine Flaschenpost tun. Diese Flaschenpost werden wir dann in irgend einer Übung in einem Halben Jahr wiederfinden.</p><p>Ausserdem kann man ein paar Zundhölzlirätsel machen: </p><p>Aus sechs Streichhölzern 4 gleich grosse Dreiecke machen</p><p>Aus 4 Streichhölzern 5 Rechtecke machen</p><p>Die münze aus der Schaufel nehmen</p>", "column3": "", "position": 3}, "c4d2d08a-ae82-4316-83f3-b550f09d553e": {"column1": "", "column2": "<p>Wir besammeln uns im Aufenthaltszelt und besprechen was wir machen könnten. Die Leiter disskutieren Laut ob wir eventuell ein Notsignalfeuer machen könnten. Andere meinen wir könnten mit steinen einen Hilferuf schreiben, damit man diesen aus der Luft sehen würde. Blubb ist der Meinung, dass wir warten sollten bis hilfe kommt und uns etwas die Zeit vertreiben sollten. wir machen Posten an denen man verschiedene Sachen lernen kann.</p>", "column3": "", "position": 0}}}'),
	('94448eaafa0d', '1', 0, NULL, '2022-02-04 22:20:19', '2022-02-04 22:20:19', 'f9ba3a735450', 'c20a38fbe5bd', 'cfccaecd4bad', 'storyboard', '{"sections": {"0b14a6e1-461d-4589-947f-d427bb9198d8": {"column1": "<p>02:00</p>", "column2": "<p>Ende</p>", "column3": "", "position": 5}, "b375ec19-ab8b-4fcb-afca-4c0163fc1b72": {"column1": "<p>00:00</p>", "column2": "<p>Die TN sitzen mit Ikarus gemütlich im Aufenthaltszelt, als plötzlich die Küche schreit: Alarm Alarm. Wir rennen sofort zur Küche und sehen noch einen Eingeborenen (Tassilo) mit einem Leib Brot davon rennen. Wir nehmen natürlich sofort die Verfolgung auf und rennen ihm hinterher. Er rennt zu einer Gruppe Eingeborenen mit einem Häuptling (Blubb) und diese bleiben stehen. Sie sind so viele, dass wir nicht direkt angreifen. Wir schreien ihn an, dass er sofort das Brot zurück geben muss. Der Häuptling findet, das ist sein Land und wir sollten sofort verschwinden. Wir sagen wir hatten einen Flugzeugabsturz und warten auf Hilfe und können nicht weg, da wir nicht wissen, wohin. Der Häuptling hält uns aber für böse Dämonen, die er vernichten muss, wir werden nie ruhig schlafen und essen auf seinem Land, bis wir weg sind. Dann verschwinden die Eingeborenen im Wald, und das Game beginnt.</p>", "column3": "", "position": 0}, "c64fd9c1-1717-4a7c-8ba9-fbf6f7508c73": {"column1": "<p>01:50</p>", "column2": "<p>Alles Essen wurde leider geklaut, Spielende. Wir gehen zurück zum Lagerplatz</p>", "column3": "", "position": 4}, "cc9d6339-d2a6-4480-98db-c16ec69c118f": {"column1": "<p>00:30</p>", "column2": "<p>Alle Gruppen haben Bändli angebunden und den Gruppenplatz bestimmt, Spielstart</p>", "column3": "", "position": 3}, "d6677cd8-35c5-4880-badf-816a13278382": {"column1": "<p>00:10</p>", "column2": "<p>Spielerklärung (Ikarus):</p><p>Auf einem Spielfeld ist das Lager eingezeichnet, und 3 verschiedene Wege, die zu 3 verschiedenen Lagern führen. Auf jedem Weg ist ein Eingeborener, der das Essen aus dem Lager klauen will. Bei jedem Lager sind 5 Essen, die geklaut werden können, wenn eine Gruppe kein Essen mehr hat, hat sie verloren. Jedes mal, wenn ein Eingeborener es bis ins Lager geschafft hat, ist ein Essen weg. Jede Viertelstunde kann ein TN pro Gruppe zum neutralen Posten kommen, und mit Bändeli Würfelwürfe kaufen. Mit jedem Würfelwurf kann man einen Eingeborenen bewegen, es ist aber egal, welchen. Wenn man aber den Eingeborenen auf einem anderen Weg näher an deren Lager führt, dann werden die Eingeborenen natürlich diesen weiter bewegen, da dieser eher Essen klauen wird.</p><p>Die Eingeborenen sind natürlich auch eine Gruppe, die versucht, möglichst viel Essen zu klauen, und auch mit Bändeli Würfelwürfe kauft, die sie jede Viertelstunde eintauscht. Jede Gruppe hat an einem Gruppenplatz einen Knäuel mit der eigenen Bändelifarbe.</p><p>Sobald der Eingeborene das Essen gelaut hat, ist er wieder auf dem Startfeld</p><p>Neutraler Posten: Ikarus</p><p>Eingeborene: Tassilo, Blinky, Jiminy, Swuppi, Zera, Blubb</p>", "column3": "", "position": 1}, "e739f40e-3812-45a0-b29d-e15d4915751e": {"column1": "<p>00:20</p>", "column2": "<p>Jede Gruppe sucht sich einen Gruppenplatz und bindet sich das Bändli an.</p>", "column3": "", "position": 2}}}'),
	('f81e2d53f972', '1', 0, NULL, '2022-02-04 19:35:38', '2022-02-04 19:35:38', 'a2505e2c8aca', '59f56d3c1631', 'cfccaecd4bad', 'storyboard', '{"sections": {"46b2cef1-e0c0-4806-95cd-fcc5ae28f394": {"column1": "", "column2": "<p>Die TN erledigen in ihren 4 Ämtligruppen die Ämtli:</p><p>- Abwaschen</p><p>- Holzen</p><p>- Joker (+ immer einmal pro Tag Lagertagebuch)</p><p>- Wasser auffüllen</p><p>Ein Leiter bleibt bei den TN währenddem die anderen höcken (nicht der Ta-Che) und \"überwacht\" die Ämtli: gibt Material fürs Holzen heraus (je nach Alter TN und Fähigkeit), schaut dass das Abwaschen speditiv läuft (Abwaschwasser gekocht etc.)</p><p>Sind die TN fertig mit ihren Ämtlis (von Leiter abgenommen und bestätigt) haben sie Siesta --&gt; Freizeit: Sie können die Voilà Freizeitangebote nutzen, die Leiter können nach ihrem Höck Spiele anbieten (wenn Zeit &amp; Lust) z.B. Volleyball. In dieser Zeit brieft der Ta-Che den Leiter, der nicht am Höck dabei war.</p>", "column3": "", "position": 0}}}'),
	('847374e5e4bf', '1', 0, NULL, '2022-02-04 22:21:03', '2022-02-04 22:21:03', '280031715953', 'd5cd5fd59e4a', 'cfccaecd4bad', 'storyboard', '{"sections": {"1a484263-02b6-48b6-911e-75535f15e53e": {"column1": "<p>0.00</p>", "column2": "<p>Wir schreiben gemeinsam das  Pfadiversprechen und das Pfadigesetz auf (TN''s sollen sagen was sie schon wissen, wir ergänzen): </p><p>Versprechen:</p><p>Ich verspreche, mein möglichstes zu tun, um </p><p>mich immer von neuem mit dem Pfadigesetz auseinanderzusetzen</p><p>nach Sinn und Ziel meines Lebens zu suchen</p><p>mich in jeder Gemeinschaft einzusetzen, in der ich lebe</p><p>(Im Vertrauen auf Gott und) Zusammen mit Euch allen versuche ich, nach diesem Versprechen zu leben. </p><p>Gesetz:</p><p>Wir Pfadi wollen...</p><p>...offen und ehrlich sein</p><p>...Freude suchen und weitergeben</p><p>...unsere Hilfe anbieten</p><p>...uns entscheiden und Verantwortung tragen</p><p>...andere verstehen und achten</p><p>...miteinander teilen</p><p>...Sorge tragen zur Natur und allem Leben</p><p>...Schwierigkeiten mit Zuversicht begegnen</p>", "column3": "", "position": 0}, "5f14e827-d5d2-496b-9caa-dedc92fea8e7": {"column1": "<p>0.20</p>", "column2": "<p>Es werden 3er Gruppen gebildet, jede Gruppe bekommt ein Couvert. Im Couvert finden sie, die Sätze des Pfadigesetze sin Stücke geschnitten. Ziel ist es zu dritt das Pfadigesetz wieder zusammen zu setzen z.B. auf einer Blache vor dem Aufenthaltszelt Sätze zusammen kleben</p><p>Sobald das Pfadigesetz zusammen gesetzt ist, sollen sich die Gruppe den wichtigsten Satz aus dem Gesetz heraussuchen.</p>", "column3": "", "position": 1}, "9da4ef60-8a0d-4583-9cec-cb39b8b0a6ba": {"column1": "<p>0.50</p>", "column2": "<p>Anschliessend treffen sich alle wieder im Aufenthaltszelt und jede Gruppe stellt den für sie wichtigsten Satz aus dem Pfadigesetz vor und es wird diskutiert warum dies sein kann oder nicht.</p>", "column3": "", "position": 2}, "b518ca3b-72f3-4afe-90ea-f2db5d10215a": {"column1": "<p>1.20</p>", "column2": "<p>Nach der Diskussion bleibt Zeit zu 2. oder zu 3. das Pfadiversprechen zu reptieren und zu lernen wer will kann Stift und Papiere haben oder es den Leitern vorsagen</p>", "column3": "", "position": 3}, "c6ae8444-e0a5-4561-869e-56ee5878053e": {"column1": "<p>1.50</p>", "column2": "<p>Wir treffen uns nochmals im Aufenthaltszelt um Fragen zu klären. Wir versuchen nochmals alle Teile des Pfadiversprechens und Pfadigesetzt zusammen zu bringen (mündlich)</p>", "column3": "", "position": 4}}}'),
	('86f38eb0029e', '1', 0, NULL, '2022-02-04 19:39:09', '2022-02-04 19:39:09', '83b61af97910', 'f6163448c705', 'cfccaecd4bad', 'storyboard', '{"sections": {"3959cbfe-56b2-4e99-9a41-e8979434fc4d": {"column1": "<p>00:00</p>", "column2": "<p>Erklärung des Ablaufs (verschiedene Phasen)</p><p>Erklärung der Special-Hogwarts-Features</p><p>Vorlesen der einzelnen Charakteren.</p><p>ausgedruckte Liste mit Charakteren aufhängen!</p>", "column3": "<p>Castor</p>", "position": 0}}}'),
	('78e81d1fbf0d', '1', 0, NULL, '2022-02-04 22:16:56', '2022-02-04 22:16:56', '69fa08a77f38', '3ce6b7ec876f', 'cfccaecd4bad', 'storyboard', '{"sections": {"173ba129-de42-44f3-8260-9231f3ae52ad": {"column1": "<p>0:30</p>", "column2": "<p>Da wir uns auf einem Langstreckenflug befinden, können die müden Passagiere sich auf die Schlafplätze begeben (Zähneputzen und in die Zelter gehen). Der Flug beginnt.</p>", "column3": "<p>Snoopy, Idefix</p>", "position": 2}, "4be9fd34-0b96-4156-8401-463154641136": {"column1": "<p>0:00</p>", "column2": "<p>Um unsere Reise sicher zu starten müssen wir alle durch die Sicherheitskontrolle: Holz Bogen mit Lichter etc wie am Flughafen, Sicherheitskontrolle bei Security (abtasten). Bei einigen TN''s piepst es und wir schmuggeln ihnen unerlaubte Gegenstände wie Wasserpistolen, Trinkflaschen etc. unter. Die TN''s mit unerlaubten Gegenstände müssen als Strafe 5 mal um die Zelter rennen und 10 Liegestützen machen. Sobald alle durch die Kontrolle sind können wir ins Flugzeug.</p>", "column3": "<p>Snoopy, Idefix</p>", "position": 0}, "e8747710-b5ba-44a5-8b13-4ee1f8acf36e": {"column1": "<p>0:15</p>", "column2": "<p>Um zum Flugzeug zu kommen laufen wir mit einem Flughafenmensch  entlang der Flugpiste (mit Kerzen oder Leuchtstäbli abgesteckt). Wir setzen uns alle im Flugzeug (Pflanzentunnel Familie Amacher, alternative: jedes Kind liegt schon an seinen Schlafplatz symbolisch für Sitzplatz) in Reihen hin (wie im Flugi). Die Flugbegleiterin / Der Flugbegleiter erklärt uns die Sicherheitsregeln und der Pilot wünscht uns einen guten Flug.</p>", "column3": "<p>Snoopy, Idefix</p>", "position": 1}}}'),
	('068370456651', '1', 0, NULL, '2022-02-04 19:38:15', '2022-02-04 19:38:15', 'c7a28bcfd35f', '142195e3898c', 'cfccaecd4bad', 'storyboard', '{"sections": {"2d22bc52-506c-4974-a969-62e7761b913d": {"column1": "<p>00:40</p>", "column2": "<p>Als nächstes Spielen wir ein Seilziehen in den Ämtli Gruppen.</p><p>Regeln vorher erklären: Niemand darf abrupt loslassen, genügend Abstand zu Bäumen, wenn man merkt, dass man nicht mehr kann sagt man es und lässt nicht einfach los, Seil nicht um Handgelenk wickeln, nur halten ...</p>", "column3": "<p>Pandora</p>", "position": 4}, "3855acd7-c71f-40dc-b81d-722f66c893a9": {"column1": "<p>00:55</p>", "column2": "<p>Zum Schluss machen wir ein Gordischer Knoten.</p>", "column3": "<p>Pandora</p>", "position": 5}, "3e147286-a967-4d4a-bc9e-c40eba38ac54": {"column1": "<p>00:10</p>", "column2": "<p>Wir spielen ein British Bulldog.</p>", "column3": "<p>Pandora</p>", "position": 1}, "8a5a895b-28d2-4bff-9321-5a3c20a30a44": {"column1": "<p>00:30</p>", "column2": "<p>Jeder nimmt sich ein TN von der anderen Abteilung. Danach spielen wir ein Blinzlerspiel.</p>", "column3": "<p>Pandora</p>", "position": 3}, "8bf60ad5-9979-4835-b0fc-4e935297ab51": {"column1": "<p>00:00</p>", "column2": "<p>Besammlung auf dem Lagerplatz. Wir spielen verschiedene Kurzspiele.</p><p>Zum Aufwärmen spielen wir ein kurzes Zitigläsä</p>", "column3": "<p>Pandora</p>", "position": 0}, "fa49a1d2-613e-4cfb-94ce-53aa8783b301": {"column1": "<p>00:20</p>", "column2": "<p>Als nächstes spielen wir ein Stock im Kreis.</p>", "column3": "<p>Pandora</p>", "position": 2}}}'),
	('e7d30e274563', '1', 0, NULL, '2022-02-04 22:19:53', '2022-02-04 22:19:53', '8e15971caab8', 'ed784a290de3', 'cfccaecd4bad', 'storyboard', '{"sections": {"2f0a0b2b-e808-40b9-8d19-245467a4aea7": {"column1": "<p>0015</p>", "column2": "<p>Um unseren oreinteierungssinn zu schärfen wird in einem definierten Feld ein gegenstand geworfen den man mit glocken hört. Nun können die Teilnehmer (sie haben sich die Augen verbunden) mithilfe ihres gehörssinnes versuchen diesen gegenstand zu finden. Dieses Spiel wird mehrmals wiederholt bis wir unsere Sinne geschärft haben.</p>", "column3": "", "position": 1}, "6a93f23c-5fb5-4924-a407-0d7c822be890": {"column1": "<p>0130</p>", "column2": "<p>Zum abschluss spielen wir ein Schoggispiel. Dabei muss sich eine Person winterhandschuhe und diverse utensilien anziehen und darf dann beginnen mit Messer und Gabel eine in in Zeitund eingepackte Schokoladentafel zu essen. Die anderen versuchen mit Würfeln eine 6 zu würfeln. wenn ihnen das gelingt muss die essende Person alle utensilien ablegen und die neue Person muss sie anlegen und darf versuchen die schokolade zu essen. vor jedem würfeln muss man einen Hampelmann machen.</p>", "column3": "", "position": 2}, "de24f984-3105-4bda-8021-393139f7e076": {"column1": "<p>0115</p>", "column2": "<p>Wir machein einen OL bei dem Jede gruppe zuerst einen Teil der Karte bekommt. nun ist ein Punkt auf einem Sichtmäpli eingezeichnet an dem der Posten sein muss. Sie müssen nun entweder abschätzen wo der neue Kartenteil sein könnte oder mit den anderen Gruppen zusammenarbeiten um dei Posten zu finden.</p>", "column3": "", "position": 0}}}'),
	('8e2119b66e8f', '1', 0, NULL, '2022-02-04 22:24:04', '2022-02-04 22:24:04', 'd81a9dae4316', '945b99f32295', 'cfccaecd4bad', 'storyboard', '{"sections": {"1b011ba0-3d74-4f5d-af48-23e9f41b3935": {"column1": "", "column2": "<p>Wir Treffen uns vor der Küche und alle Kinder werfen ihren Anonymen Brief in denn Pfaditopf. Danach wird nachmals der ganze Ablauf erklärt. </p><p>1. Still zum Bi-Pi Feuer laufen.</p><p>2. Feuer anzünden</p><p>3. Brief</p><p>4. Abteilungslied singen</p><p>5. Private Zettel vorlessen</p>", "column3": "", "position": 0}, "a6533cc3-ff37-4d9f-b9db-3016c0a8ec3f": {"column1": "", "column2": "<p>Zusammen Laufen wir zum Bi-Pi Feuer und geniessen unser Ritual.</p><p>1. Der Feuermeister macht Feuer</p><p>2. Zera liest den Letzten Brief von Bi-Pi vor</p><p>3. Wir Singen das Abteilungslied</p><p>4. Wir geben denn Kessel durch und jeder zieht einen Zettel der er vorliest</p>", "column3": "", "position": 1}, "b9e5b5ac-6a1d-4756-800c-e18bb3b7858c": {"column1": "", "column2": "<p>laufen die Kinder (vereinzelt) zurück zum Lagerplatz wenn sie alles überdenkt haben.</p><p> Danach gibt es das Lagerfeuer-feeling in der Küche mit Schoggi-Bananen und Marshmallows.</p>", "column3": "", "position": 2}}}'),
	('e9d479b98d18', '1', 0, NULL, '2022-02-04 22:10:52', '2022-02-04 22:10:52', '78c9196140b7', '16c1b1868c60', 'cfccaecd4bad', 'storyboard', '{"sections": {"44e06a87-519e-47df-81e7-5e18eebf2d92": {"column1": "", "column2": "<p>Wir treffen uns um 18:00 am Bahnhof Oerlikon.</p>", "column3": "", "position": 0}, "67fb26c3-3dbb-44f3-9341-f5303debb367": {"column1": "", "column2": "<p>Wir laufen zum Lagerplatz</p>", "column3": "", "position": 3}, "a29e95f2-1d57-43f2-812d-a6fcabaed1e9": {"column1": "", "column2": "<p>Wir nahmen den 10er in Zürich Bhf Oerlikon Ost richtung Flughafen um 18:31 ankunft 1844 in zürich Flughafen</p>", "column3": "", "position": 1}, "a9215894-d25e-4e54-b932-71f78f2f2e90": {"column1": "", "column2": "<p>18:49 BUS 524 8063 Richtung Oberembrach, Dorf bis nach Lufigen Augwil. Ankunft 18:58</p>", "column3": "", "position": 2}}}'),
	('ac207e1f00cb', '1', 0, NULL, '2022-02-04 22:27:21', '2022-02-04 22:27:21', '13d74b9d52b8', '09b019b76b75', 'cfccaecd4bad', 'storyboard', '{"sections": {"4ae2e2c4-a675-4677-b758-52d7b7d8f9c5": {"column1": "", "column2": "<p>Beim Aufenthaltszelt wird den Kindern erklärt was eine A Blache und was eine B Blache ist. Nun müssen die Kinder die A Blachen von den B Blachen trennen und ein Leiter demonstriert ihnen wie man eine Reepschnur korrekt einfädelt. Die Kinder machen das nach und fassen die Blachen in 10erhäufen zusammen.  Am schluss machen sie zuerst gemeinsam mit einem Leiter und dann alleine Blachenbünde.</p>", "column3": "", "position": 2}, "8c514b4d-22e8-4eb4-a786-d39210d90211": {"column1": "", "column2": "<p>Bei den Schlafzelten zeigen die Leiter den Teilnehmern wie sie ein Spatz korrekt abbauen und reinigen. Die Kinder machen das nach.</p>", "column3": "", "position": 1}, "c6d5f878-f523-47c7-8706-e1f5d69c1124": {"column1": "", "column2": "<p>Wir bilden Gruppen in denen wir die einzelnen Lagerbauten wieder korrekt versorgen.</p><p>Gruppe eins: Schlafzelte</p><p>Gruppe zwei: Aufenthaltszelt + Latrine</p>", "column3": "", "position": 0}}}'),
	('bbc4c3603119', '1', 0, NULL, '2022-02-04 22:24:36', '2022-02-04 22:24:36', 'e460f03e79b4', 'e69cb9c4d43c', 'cfccaecd4bad', 'storyboard', '{"sections": {"206ac116-1262-444c-9f59-9682e42f8ff9": {"column1": "<p>00.05</p>", "column2": "<p>Aufwecken mit Musik</p>", "column3": "", "position": 0}, "2e13bd7e-cd50-445e-8c96-29941416fc00": {"column1": "<p>00.30</p>", "column2": "<p>Gordischer Knoten :Einer geht 1 minute weg und die restlichen Personen müssen sich so gut wies geht verknoten das ziel ist das die eine person den knoten wieder aufmacht. ÄSSÄÄÄÄÄ</p>", "column3": "", "position": 2}, "9ba6a3b0-201b-4f75-a5b5-9e483d7bdae5": {"column1": "<p>00.20</p>", "column2": "<p>Triffdendödel: Alle stehen in einem Kreis und man wirft eine mit Wassergefüllten Pet Flasche einer Person zu und die Person mus die Flasche einhändig fangen wenn er sie nicht fängt mus er um den kreis rennen und man kann ihn abwerfen er muss solang er getroffen wird rundenen rennen bis er es ihn seine lücke schafft.</p>", "column3": "", "position": 1}}}'),
	('fd621d723248', '1', 0, NULL, '2022-02-04 21:27:43', '2022-02-04 21:27:43', '69a1c2680b2b', 'a47e986e9179', 'cfccaecd4bad', 'storyboard', '{"sections": {"0af8985c-7dc9-4b59-bad6-b2e96f5da79a": {"column1": "", "column2": "", "column3": "", "position": 0}, "87ecdd97-547f-471f-9fe0-212cc321b8dc": {"column1": "", "column2": "<p>Hallo Velo Gigs</p>", "column3": "", "position": 1}}}'),
	('3127de277825', '1', 0, NULL, '2022-02-04 22:21:35', '2022-02-04 22:21:35', 'd4fe28437432', 'a046328425df', 'cfccaecd4bad', 'storyboard', '{"sections": {"2db45c1d-1e89-4158-9446-507d04f49410": {"column1": "<p>00.00</p>", "column2": "<p>Wir finden eine essens-, federspur und folgen dieser, weil das ja sciher die aboriginis waren</p>", "column3": "", "position": 0}, "447f6da8-8a92-4d46-bf16-15122af9e9eb": {"column1": "<p>00.15</p>", "column2": "<p>Wir finden das Aboriginis versteck, jedoch bewachen sie ihren Vorrat und wir überlegen uns wie wir sie ablenken können. (Sackmesser, Taschenlampen, musik, einfach neue dinge, die sie nicht kennen)</p>", "column3": "", "position": 1}, "5461cc5a-9e82-4316-878d-089da74030d0": {"column1": "<p>00.20</p>", "column2": "<p>Auf ihrem Vorrat (ein loch) hat es aufgeblasene Ballone und essensreste (schweine magen, also weisse ballone), die wir zuerst verplatzen müssen. ein teil der Kinder lenkt die Aboriginis ab (ohne berühren) und die andern müssen die Ballone verplatzen gehen und haben drei leere Ballone dabei. Doch bei jedem platzen, rennt ein aborgini los und versucht den TN zu catchen, wenn ers geschafft hat muss der Tn ihm ein Ballon abgeben. Die TNs müssen hinter eine sicherheits linie rennen und dort sind sie dann safe. Für neue Ballone müssen die Tns fragen beantworten oder Aufgaben machen. Ziel ist, dass alle ballone im Vorrat geplatzt sind und wir unser essen zurück holen können.</p>", "column3": "", "position": 2}, "67e942b4-a254-4423-a95a-85311e45d532": {"column1": "<p>1.10</p>", "column2": "<p>Die Aboriginis sind geschlagen, wir haben unser essen wieder und laufen glücklich zum lagerplatz zurück.</p>", "column3": "", "position": 3}}}'),
	('9e69a2d0f217', '1', 1, 'Schlechtwetterprogramm', '2022-02-04 21:14:27', '2022-02-04 21:15:40', 'a71f929dd156', 'bd796fec1ea0', 'cfccaecd4bad', 'storyboard', '{"sections": {"3e80526d-f6eb-415f-aa66-c4d14c80d83a": {"column1": "", "column2": "<p>Zelte müssen trotzdem aufgebaut werden.</p><p>Zvieri bei Unterstand</p>", "column3": "", "position": 0}}}'),
	('f28ae87dfdcd', '1', 0, NULL, '2022-02-04 22:22:56', '2022-02-04 22:22:56', '475f7b34581a', '0c57930a0e67', 'cfccaecd4bad', 'storyboard', '{"sections": {"129c06d1-4b4d-49d2-a83f-507d89463ffc": {"column1": "<p>00:20</p>", "column2": "<p>Spielstart</p><p>Tassilo(Pilot) und Blinky(Eingeborener) verkleiden sich für später.</p>", "column3": "", "position": 3}, "14c147cf-f9af-41da-9f1e-d594fb848575": {"column1": "<p>14:20</p>", "column2": "<p>Bagheera und Maki werden über das bevorstehende Game aufgeklärt. Sie müssen je eine kleine rolle übernehmen. Beide möchten von dieser Insel weg jedoch die andere Person bzw Gruppe nicht dabei haben.</p>", "column3": "", "position": 0}, "4d769fe7-420a-40cd-a497-110f43edebea": {"column1": "<p>00:00</p>", "column2": "<p>Bagheera und Maki streiten im Aufenthaltszelt. Blinky bildet 2 Gruppen -&gt; Der Grösse nach aufstellen und auf 2 nummerieren. </p><p>Blinky läuft dann mit beiden Gruppen in den Wald</p>", "column3": "", "position": 1}, "9271d5a0-ff4e-4f6f-a7d1-eab644eed6e7": {"column1": "<p>01:50</p>", "column2": "<p>Zurücklaufen mit Tassilo. Eingeborene laufen zurück in den Wald.</p>", "column3": "", "position": 6}, "b7cc715e-75ff-41c3-b9e1-adf3692da030": {"column1": "<p>01:40</p>", "column2": "<p>Spielende</p><p>Alle TNs besammeln sich. Sie schauen sich zusammen mit den Eingeborenen die Notsignale an. Die Eingeborenen sind beidruckt und helfen beim aufräumen dürfen dafür aber die Leuchtstäbe behalten. Der Pilot ist abgehauen -&gt; wieder als Leiter anwesend</p>", "column3": "", "position": 5}, "b9bfc7cd-4d5a-4287-b6fe-32e3497d0d1b": {"column1": "<p>00:30</p>", "column2": "<p>Pilot (Tassilo)und eingeborene(alle Leiter) klauen Stäbchen min. 1 Eingeborener ist hierbei beim neutralen Posten (erste paar Minuten Blinky).</p>", "column3": "", "position": 4}, "ff5a0167-2060-42e9-810a-c79409b1ffb6": {"column1": "<p>00:10</p>", "column2": "<p>SPIELERKLÄRUNG (Blinky):</p><p>Es muss ein Notsignal gesendet werden. Beide Parteien haben dafür je ein mit Absperrband abgesperrter Bereich im Wald (ca5x5m) mit je 10 Leuchtstäbchen. Beide Teams müssen versuchen ein Leuchtstäbchen vom Gegnerischen Bereich Klauen und zu ihrer eigenen Base bringen. Wer am meisten Leuchtstäbchen in seiner Base hat gewonnen und darf das Notsignal mit den Stäbchen schreiben. Umeinander davon abzuhalten ihre Leuchtstäbchen zu klauen kann 3 mal auf den rücken des Angreifers geklopft werden (wenn dieser ein Leuchstäbchen hat muss er dieses zurück gebeb). Der beklopfte muss dann auf der stelle 5 Liegestützen machen und zurück zur seiner Base gehen.</p><p>Die Eingeborenen klauen währenddessen immer wieder Leuchtstäbchen weil sie diese für Magische Stöckchen halten.</p><p>Die Leuchtstächen können dann wieder an einem neutralen Posten mit PfadiTech Wissen oder wenn 2 gegnerische TNs ein Leuchtstäbchen wollen mit einer Challenge zurückerobert werden.</p><p>SPIELABRUCH/ENDE:</p><p>3x pfeifen</p>", "column3": "", "position": 2}}}'),
	('ad3c129b71fd', '1', 0, NULL, '2022-02-04 22:18:46', '2022-02-04 22:18:46', '3a9614e39661', 'f63fb7a48ada', 'cfccaecd4bad', 'storyboard', '{"sections": {"cae7bc0e-945e-4796-8cec-5e9c248920fc": {"column1": "", "column2": "<p>Wir bessern aus was auszubessern ist</p>", "column3": "", "position": 0}}}'),
	('1a978f02a760', '1', 0, NULL, '2022-02-04 22:22:38', '2022-02-04 22:22:38', '2b3f79233387', '8d3112f28a34', 'cfccaecd4bad', 'storyboard', '{"sections": {"52742387-99a9-496a-9926-b6d3c13f513a": {"column1": "<p>00.00</p>", "column2": "<p>Jemand liest das Verspechen lauf vor.</p><p>Wir machen vier (Je nach anmeldungen fünf) Gruppen.</p><p>in Posten besprechen sie mit einem Leiter ein Stück des Versprechens.</p><p>bedeutung, umsetzung etc.</p><p>Posten 1: Ich verspreche/ mein Möglichstes zu tun</p><p>Posten 2: mich immer von neuem mit dem Pfadigesetz auseinanderzusetzen</p><p>Posten3:mich in jeder Gemeinschaft einzusetzen, in der ich lebe</p><p>Posten4:Nach Sinn und Ziel meines Lebens zu suchen</p><p>Posten5:zusammen mit euch allen</p>", "column3": "", "position": 0}, "d33f6055-65e1-441b-8110-a3689e2b7fa5": {"column1": "<p>1.00</p>", "column2": "<p>Wir lernen das Pfadiversprechen mit dem \"Ich packe in meinen Rucksack\"-Spiel </p><p>Es beginnt jeamd und sagt \"Ich...\" und dann der reihe nach immer wieder holen was die andern zuvor gesagt haben und das nächste Wort des Versprechens nennen.</p>", "column3": "", "position": 1}}}'),
	('d2187a3531af', '1', 0, NULL, '2022-02-04 19:52:33', '2022-02-04 19:52:33', 'ca9582689c1e', 'baeb0218568b', 'cfccaecd4bad', 'storyboard', '{"sections": {"2528747e-cf8b-48e2-92c9-76ebad4d9051": {"column1": "<p>0''</p>", "column2": "<p>Kopfhörer holen und looos</p>", "column3": "", "position": 0}, "f0a54d25-e7b8-413e-9264-de10cc62c893": {"column1": "<p>5''</p>", "column2": "<p>Chanel 3 ist Russendisko</p><p>Chanel 1 ist nur Harry Potter Musik</p>", "column3": "", "position": 1}}}'),
	('a6912f41f6c0', '1', 0, NULL, '2022-02-04 19:34:29', '2022-02-04 19:34:29', 'ff2ed0cab03e', 'fec746d4520a', 'cfccaecd4bad', 'storyboard', '{"sections": {"407183cc-6c55-410d-9dbe-b950aa15188a": {"column1": "<p>00:20</p>", "column2": "<p>Einteilung in schnelle und langsame Gruppe</p>", "column3": "<p>selbständig</p>", "position": 2}, "586b35d3-a01d-410d-b7c1-d96d7bd341b2": {"column1": "<p>00:00</p>", "column2": "<p>Einreihen der Velos &amp; Luftkontrolle</p>", "column3": "<p>Castor</p>", "position": 0}, "6f01d9e4-52fa-4081-b3c4-5f847c138990": {"column1": "<p>00:30</p>", "column2": "<p>Abfahrt</p><p>Trinkpausen sind in der MZB vermerkt</p>", "column3": "<p>Castor &amp; Taifun</p>", "position": 3}, "763e4168-7b23-4fcb-8f0c-f38e93ba9163": {"column1": "<p>00:10</p>", "column2": "<p>Begrüssung &amp; Einsammeln von NFBs</p><p>Einleitung RF</p>", "column3": "<p>Farfalla</p>", "position": 1}}}'),
	('f5b193a90c4f', '1', 0, NULL, '2022-02-04 22:17:30', '2022-02-04 22:17:30', '5015df0b6259', '69c2c7eceec2', 'cfccaecd4bad', 'storyboard', '{"sections": {"1654a176-901e-46ba-bafd-cd3da86a3f02": {"column1": "<p>00:15</p>", "column2": "<p>Alle Kinder sind auf ihren Sitzplätzen angeschnallt, dann beginnt eines der Triebwerke zu brennen und die Sauerstoffmasken kommen aus der Decke, sie müssen diese alle Anziehen.</p>", "column3": "", "position": 1}, "740d442c-5681-4fd2-8c92-82a64abe6d28": {"column1": "<p>00:25</p>", "column2": "<p>Wir regen uns langsam am Boden, um uns herum das zerstörte und brennende Flugzeug. Einem Leiter wurde der Arm aufgeschlitzt (Blinky) und er blutet stark, um erste Hilfe zu leisten suchen wir die Apotheke im Flugzeug. Wir versuchen, Rettungskräfte zu kontaktieren, haben aber kein Netz. Nachdem wir festgestellt haben, dass alle da sind und der verletzte Leiter versorgt ist, teilen wir Wachen  ein (nur die Leiter, die wachen nicht wirklich sondern gehen dann schlafen) und schicken die TN wieder ins Bett.</p>", "column3": "", "position": 3}, "7a217759-3847-4ede-9daf-f8a8db4b2f8d": {"column1": "<p>00:20</p>", "column2": "<p>Ein Triebwerk explodiert und kurz darauf schlagen wir auf, die Leiter stossen alle Kinder durcheinander und werfen die \"Stühle\" um, um den Absturz zu simulieren.</p>", "column3": "", "position": 2}, "f065e540-3d15-4542-bc08-2541d3d3db1e": {"column1": "<p>00:00</p>", "column2": "<p>Die TN werden von lautem Sirenengeheul geweckt. Ein Triebwerk des Flugzeugs, in dem wir fliegen, ist ausgefalllen. Alle müssen sofort auf ihre Sitzplätze und die Gurte anschnallen.</p>", "column3": "", "position": 0}}}'),
	('3a94193d3f6e', '1', 0, NULL, '2022-02-04 22:23:30', '2022-02-04 22:23:30', '3ddaa17f2649', '706d570b83cc', 'cfccaecd4bad', 'storyboard', '{"sections": {"e4b7599b-abab-4c70-8bb9-df4202f2b683": {"column1": "", "column2": "<p>Nach dem Zvieri Sagen wir den Kindern, dass es heute Abend ein Bi-Pi Feuer geben wird. Wir erklären, was das Bi-Pi Feuer ist. Für das Bi-Pi Feuer müssen natürlich vorbereitungen getroffen:</p><p>Zum einen muss jeder etwas gutes, etwas schlechtes (zur Pfadi) und einen Wunsch sowie ein Danke oder einen Glückwunsch aufschreiben (alles Anonym)</p><p>Ausserdem werden auch zwei freiwillige das Feuer nach Anleitung vorbereiten.</p><p>Das Bi-Pi Feuer ist eine Tradition die die Pfadi schon seit ewigkeiten durchführt beim Bi-Pi Feuer wird der Letzte Brief von Bi-Pi vorgelesen und der Rest ist relativ Frei. Dennoch gibt es viele Regeln die eingehalten werden müssen.</p><p>-Es besteht aus einem Inneren und einem ausseren Steinkreis</p><p>-Die untersten zwei Hölzer sind nach der Nord-Südachse ausgerichtet</p><p>-Das Feuer darf nur mit einer Fackel oder einer glühenden Kohle angezündet werden</p><p>-Am Anfang wird ein Feuerwächter bestimmt der das Feuer entfacht</p><p>-Nur der Feuerwächter darf in den 2. Steinkreis hinein und auch nur wenn er einen Stein entfernt</p><p>-Die Kohle wird direkt nach dem Anzünden in das Feuer gelegt</p><p>-Das Feuer muss ausbrennen und darf nicht ausgelöscht werden</p><p>-Wenn die Glut ausgekühlt ist bekommen alle anwesenden ein bisschen Kohle die sie dann im nächsten Bi-Pi Feuer wieder verwendet werden können. So brennt das Feuer immer weiter</p>", "column3": "", "position": 0}}}'),
	('00c6fe37b137', '1', 0, NULL, '2022-02-04 22:11:12', '2022-02-04 22:11:12', 'c2eae59077c5', '667d18a76fe6', 'cfccaecd4bad', 'storyboard', '{"sections": {"2079d41d-9398-484a-b2f0-e5c2cd2c5d6a": {"column1": "", "column2": "<p>Wir machen vier Gruppen.</p><p>Gruppe1 Küche-Aufenthalt-Essenszelt</p><p>Gruppe2 Schlafzelter</p><p>Gruppe3 Kücheninneneinrichtung</p><p>Gruppe4 Latrine</p>", "column3": "", "position": 0}, "c1932814-476e-4ca1-bb7b-965bead38ef2": {"column1": "", "column2": "<p>Alle Gruppe überlegen wo sie Ihre Zelter / Bauten Aufstellen möchten und zeichnen ein Plan-Krokki auf ein Packpapier. Für Ausbesserungen und Fragen steht Tassilo bereit.</p>", "column3": "", "position": 1}, "d82b9038-2f38-44d4-9238-83dd6bc68aa5": {"column1": "", "column2": "<p>Gruppe2 beginnt mit dem Aufbau der Schlafzelter</p><p>Dazu zeigt der Gruppenleiter zuerst vor, wie man in einer 3er Gruppe einen Spatz aufstellt. Dann werden 3 er Gruppen gebildet und die TN wiederholen das gezeigte mit dem Aufbau von weiteren Spatzen. </p><p>Gruppe1, Gruppe3 und Gruppe4 Der Gruppenleiter zeigt vor, wie gewisse Tätigkeiten (Seil spannen, Blachen mit Seil spannen, Blachen knöpfen) richtig gemacht werden. Dann wiederholen die TN das gezeigte an den weiteren Stellen, wo das gemacht werden muss.</p>", "column3": "", "position": 2}, "fd7ea45c-c418-47d0-8989-9a5d0384e607": {"column1": "", "column2": "<p>Alle Zelter sind Aufgestellt und besprechen wo es Schwierigkeiten gegeben hat und wie man es besser lösen könnte.</p>", "column3": "", "position": 3}}}'),
	('41463d5e6898', '1', 0, NULL, '2022-02-04 21:31:04', '2022-02-04 21:31:04', '3edf02e5fd3d', '51a9f1de497a', 'cfccaecd4bad', 'storyboard', '{"sections": {"3c1df90a-20e9-48ba-a1ca-6480ea357dd9": {"column1": "", "column2": "<p>Titel/Thema:</p><p>Blutiger Baron - Wut</p><p>Zielgruppe:</p><p>Pfadistufenkinder 11-14Jahre</p><p>LeiterIn:</p><p>Castor, Salamander</p><p>Zeit:</p><p>30 min. (07.07.201522:30 - 23:00)</p><p>Ort/ Gelände:</p><p>Spielwiese</p><p>Ziele:</p><p>Die TN erweitern ihren Handlungsspielraum im Umgang mit Wut.</p>", "column3": "", "position": 0}, "99a11f92-9b90-492c-96a9-c6381db0d2a6": {"column1": "<p>5i</p>", "column2": "<p>Abschluss</p><p>Der blutige Baron ist sehr zufrieden mit unseren Tns. Da er der Hausgeist von Slytherin ist und wir wissen, dass das Haussymbol der Slytherins eine Schlange ist, machen wir zum Abschluss einen „Der Schlange ihre Tanz“.</p>", "column3": "", "position": 3}, "cb45923e-bb45-45ea-b979-00b7a2646b0d": {"column1": "<p>20''</p>", "column2": "<p>Hauptteil:</p><p>Die TN hocken in den Häuser (4 Gruppen) zusammen und machen ein Theäterli zum Thema „WUT“. Davon machen sie eine schlechte und eine gute Variante.</p><p>Oberbegriffe – Ideen zu den Theäterli</p><p>-Schule</p><p>-Pfadi</p><p>-Eltern</p><p>-Öffentlichkeit</p><p>– Schlange stehen</p><p>5'' Vorbereitungszeit</p><p>Danach Aufführung der Theäterli. Nach jedem Theater kurze Diskussion angeregt durch den Baron.</p><p>5'' Um uns im Ruhigbleiben zu üben schlägt der Baron einen magischen Augenkampf vor.</p><p>Immer 2 zusammen, man muss einander in die Augen schauen und dabei möglichst ruhig bleiben.</p>", "column3": "", "position": 2}, "e8567d7c-a5df-42bd-a04b-3b5e6f17eb8b": {"column1": "<p>5''</p>", "column2": "<p>Einstieg:</p><p>Blutiger Baron stösst zu uns und erklärt uns seine missliche Lage.</p><p>Er zeigt uns völlig demütig seine Ketten.</p><p>Ketten &amp; Kugeln (vom Leiterfest)</p>", "column3": "<p>Salamander (blutiger Baron)</p>", "position": 1}}}'),
	('8fc6eca9bc8a', '1', 0, NULL, '2022-02-04 22:27:57', '2022-02-04 22:27:57', '193c3491fa23', '604b01a8ece1', 'cfccaecd4bad', 'storyboard', '{"sections": {"58ee91ff-5393-4e4d-a7f8-c3a55008f11f": {"column1": "", "column2": "<p>14:44 BUS 520 15613 Richtung Zürich Flughafen, Bahnhof /nach Zürich Flughafen, Bahnhof /Ankunft 14:55</p><p>15:01 Zug S 16 19657 Richtung Herrliberg-Feldmeilen / nach Zürich Oerlikon, Gleis 6 /Ankunft 15:05</p>", "column3": "", "position": 1}, "5b6c91db-3d93-4b0d-ba39-16a729c9a886": {"column1": "", "column2": "<p>Wir laufen 1420 los</p>", "column3": "", "position": 0}}}'),
	('e3a4242a7d93', '1', 0, NULL, '2022-02-04 22:18:02', '2022-02-04 22:18:02', 'aff5fa86266e', 'fbc47b8cf426', 'cfccaecd4bad', 'storyboard', '{"sections": {"4e375ecc-ccef-4799-ad5f-fb9d424e2e64": {"column1": "<p>0025</p>", "column2": "<p>Als Hauptteil gehen wir in der näheren umgebung Joggen. Die Leitperson gibt immer wieder Kommandos vor bei welchen alle die vorgegebene übung machen müssen. z.B. bei 1 müssen alle springen.</p>", "column3": "", "position": 1}, "8fafcb32-385a-40eb-979b-f61f3b1fa584": {"column1": "<p>0010</p>", "column2": "<p>Zum einwärmen machen wir ein Pferderennen. Dabei klatschen sich alle mit den Händen auf die Oberschenkel um das Hufgetrappel zu simulieren. Der Spielleiter gibt dann kommandos welche dann von allen durchgeführt werden müssen wenn jemand ein Kommando verpasst oder ein Kommado falsch macht muss 3 Liegestütze machen. z.B. bei der Linkskurve lehnen alle nach links</p>", "column3": "", "position": 0}, "c63cd87c-d985-4128-a085-3fb066ae5d53": {"column1": "<p>0030</p>", "column2": "<p>Zum Abschluss spielen wir noch ein Peng. Dabei wird zuerst ein Thema definiert z. B. Produkte aus der Migros. Das Ziel des Spiels ist es, dass man bis zum Schluss nicht ausgeschieden wird. Dann stellen sich immer zwei Personen Rücken an Rücken und gehen los. Dann sagt der Spielleiter einen Buchstaben und die Kinder müssen sich umdrehen und so schnell wie möglich ein Migros Produkt sagen, dass mit diesem Buchstaben anfängt. Wenn man verliert wird man ausgeschieden.</p>", "column3": "", "position": 2}}}'),
	('8245d44306f4', '1', 0, NULL, '2022-02-04 19:36:21', '2022-02-04 19:36:21', 'a71f929dd156', 'bd796fec1ea0', 'cfccaecd4bad', 'storyboard', '{"sections": {"0d01135d-67c2-4473-8ad7-012a54f86b11": {"column1": "<p>''200 - ''240</p>", "column2": "<p>Zelte wahrscheinlich fertig, dann:</p><p>J&amp;S Material holen (mit Veloanhänger)</p><p>Wasserschlauch von Waldran bis Lagerplatz anschliessen</p>", "column3": "", "position": 4}, "75b3d84e-744a-46cc-b97d-535e4b68dfa2": {"column1": "<p>''200 - ''210</p>", "column2": "<p>gemeinsame Trinkpause und kurzes Spiel (Ritter auf Ritter ab)</p>", "column3": "", "position": 3}, "834709ae-7423-4c1a-8c48-1d7240a7d08a": {"column1": "<p>''120 - ''140</p>", "column2": "<p>Z''Vieri</p>", "column3": "", "position": 1}, "8c6911b3-8da5-43bf-aaa5-2d0aa0035533": {"column1": "<p>''00 - ''120</p>", "column2": "<p>Aufteilung in Gruppen:</p><p>Gruppe 1 (5TN + 1 Leiter): Zelte aufstellen</p><p>Gruppe 2 (3TN + 1 Leiter): Latrine buddeln</p><p>Gruppe 3 (7TN + 1 Leiter): Aufenthaltszelt (Blachen knüpfen und hochziehen)</p><p>Gruppe 4 (5TN + 1 Leiter): Küchenzelt, Kochstelle, Sickergrube</p><p>(ab und zu Trinkpausen machen)</p>", "column3": "", "position": 0}, "c92d69d8-7841-40d6-804b-5cf7b18d5cfd": {"column1": "<p>''140-''200</p>", "column2": "<p>weiter aufbauen (je nach Gruppenstimmung Gruppen wechseln)</p>", "column3": "", "position": 2}}}'),
	('ea49fbe4a79b', '1', 0, NULL, '2022-02-04 21:25:26', '2022-02-04 21:25:26', '645000130f8c', '645000130f8c', 'cfccaecd4bad', 'storyboard', '{"sections": {"907e4d4f-5d07-470f-a70d-a3aa374af82a": {"column1": "<p>''00</p>", "column2": "<p>Übermittlung: Skippy, Castor</p><p>Kochen: Daniel Düsentrieb,</p><p>Tätschmeischter: Salamander</p><p>Sport: Adler &amp; Taifun &amp; Pandora</p><p>Pionier: Biber</p><p>Den TN werden zu Beginn die einzelnen Spez-Exer vorgestellt und sie können sich dann entscheiden, welchen sie machen möchten. Wenn sich für ein Spez-Exer nur ein TN begeistert, wird dieser leider nicht durchgeführt. Die Leiter die keinen fixen Spez-Exer haben, helfen den anderen wo nötig.</p>", "column3": "", "position": 0}}}'),
	('fdd159859a9f', '1', 1, 'et', '2022-01-23 16:19:10', '2022-01-23 16:19:10', '63ad36c59b9e', '63ad36c59b9e', 'cfccaecd4bad', 'storyboard', '{"sections": {"3bdc90b4-3b4c-4c76-b1bc-2e376afbb5aa": {"column1": "culpa", "column2": "natus", "column3": "consequatur", "position": 0}}}'),
